Ïù¥Î•º Îã¨ÏÑ±ÌïòÍ∏∞ ÏúÑÌï¥ HTML ÏÜçÏÑ±(alt, className, href, rel, src, target)ÏùÑ ÎÇòÌÉÄÎÇ¥Îäî Î¨∏ÏûêÏó¥ Î∞∞Ïó¥Ïù¥ ÏÉùÏÑ±ÎêúÎã§. Ïù¥ Î©îÏÑúÎìúÎäî Ïù¥ Î∞∞Ïó¥ÏùÑ Î∞òÎ≥µÌïòÎ©∞ props Í∞ùÏ≤¥Ïóê Ìï¥Îãπ ÏÜçÏÑ±Ïù¥ ÏûàÎäî Í≤ΩÏö∞ ÏöîÏÜåÏóê Ìï¥Îãπ ÏÜçÏÑ±ÏùÑ ÏÑ§Ï†ïÌïúÎã§. ÎßàÏßÄÎßâÏúºÎ°ú Ìï®ÏàòÎäî ÏÉùÏÑ±Îêú HTML ÏöîÏÜåÎ•º Î∞òÌôòÌïúÎã§.

